All the credits go to s-mouche for encoding this rare cartoon.  :)


    Sissi's, a unique bavarian girl's life changes forever after the day she meets the charming and noble princes, Franz and Karl. It doesn't take long till Sissi and Franz start to make plans for a future together, but there are so many people who make sure that the magnificent wedding day is delayed and posponed several times. Sissi and Franz must face jealousy, deceit, treason, danger even between the fronts of Austria and Hungary. Does love really conquer all? 
    Find out by following these fantastic adventures from the Europe of the 19th century.


